(2, 'SEO', 'enable_friendly_urls', 'true', 'true', 'true / false', 'Friendly URL''s for stories', 'Use the story title in the url by setting this value to true. Example: /story/(story title)/', 'define', NULL),
(3, 'SEO', 'enable_friendly_caturls', 'true', 'true', 'true / false', 'Friendly URL''s for categories', 'Use the category name in urls by setting this to true. Example: /category/(categoryname)/', 'define', NULL),
