(41, 'Tell-a-Friend', 'Send_From_Email', 'admin@waterfangeeks.eu', 'noreply@pligg.com', 'email address', 'Sent from email', 'Email address email is sent from.', 'define', '"'),
(43, 'Misc', 'SearchMethod', '3', '3', '1 - 4', 'Search method', '<br><b>1</b> = uses MySQL MATCH for FULLTEXT indexes (or something). <b>Problems are MySQL STOP words and words less than 4 characters. Note: these limitations do not affect clicking on a TAG to search by it.</b>\r\n<br><b>2</b> = uses MySQL LIKE and is much slower, but returns better results. Also supports "*" and "-"\r\n<br><b>3</b> = is a hybrid, using method 1 if possible, but method 2 if needed.<br><b>4</b> = uses Google to search your site.', 'define', NULL),
(45, 'Anonymous', 'anonymous_vote', 'true', 'false', 'true / false', 'Anonymous vote', 'Allow anonymous users to vote on articles.', 'define', '"'),
