(95, 'XmlSitemaps', 'XmlSitemaps_ping_ask', 'true', 'false', 'true / false', 'Ping Ask.com?', 'Ping Ask.com when new story posted', 'define', NULL),
(96, 'XmlSitemaps', 'XmlSitemaps_ping_yahoo', 'true', 'false', 'true / false', 'Ping Yahoo?', 'Ping Yahoo! when new story posted', 'define', NULL),
(97, 'XmlSitemaps', 'XmlSitemaps_yahoo_key', '8v_ohIHV34FuTGIsdcTKfZnnkuzueJYQ4L6Br9cz6E97x4BuwF8hh1dFiUkR', '', 'alphanumeric key from yahoo.com', 'Yahoo siteexplorer key', 'This key is required if you want to ping yahoo,<br />Don''t have one? get it <a href="http://developer.yahoo.com/wsregapp/index.php">here</a>', 'define', NULL),
(98, 'XmlSitemaps', 'XmlSitemaps_friendly_url', 'true', 'false', 'true / false', 'Sitemap Friendly URLs', 'This makes friendly sitemap urls<br />you''ll have to add this to .htaccess: <br />RewriteRule ^sitemapindex.xml module.php?module=xml_sitemaps_show_sitemap [L]<br />RewriteRule ^sitemap-([0-9a-z]+).xml module.php?module=xml_sitemaps_show_sitemap&i=$1 [L]<br />It seems ask.com does not accept sitemaps that do not end in .xml so you''ll need this if you want to send the sitemap to ask.com', 'define', NULL),
(99, 'XmlSitemaps', 'XmlSitemaps_Links_per_sitemap', '500', '500', 'positive numerical value', 'Links per Sitemap', 'This module generates an index of sitemaps, here you can set the number of links you want to include in one sitemap from that index', 'define', NULL),
(100, 'XmlSitemaps', 'XmlSitemaps_use_cache', 'false', 'false', 'boolean', 'Use cache', 'Serve the sitemap from the disk cache, and don''t ping any services untill the cache expires', 'define', NULL),
