(18, 1, 'published', 2368536, 106, 0, 0, '1.00', '2009-12-29 21:37:37', '2009-12-29 11:01:23', '2009-12-29 11:01:24', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=5ab080c2897a5f902d579784136996da', 'Compaq Presario CQ61Z Notebook - Customizable - Lowest Price: $399.99', 'Compaq Presario CQ61Z Notebook - Customizable - Lowest Price: $399.99', 'compaq-presario-cq61z-notebook---customizable---lowest-price-399-99', 'Compaq Presario CQ61Z notebook series delivers classic style, simple operation, and features for easy everyday computing, all at an affordable price. This easy-to-use laptop has everything you need for your day-to-day e-mailing, work, and communication, whether you are at home, in the office, or on the move.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'Compaq Presario CQ61Z notebook series delivers classic style, simple operation, and features for easy everyday computing, all at an affordable price. This easy-to-use laptop has everything you need for your day-to-day e-mailing, work, and communication, whether you are at home, in the office, or on the move.          ', 'compaq, presario, cqz, notebook, , customizable, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(19, 1, 'published', 364367, 107, 0, 0, '1.00', '2009-12-29 11:11:07', '2009-12-29 11:11:07', '2009-12-29 11:11:07', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=87b11348c1ba4dff8226fa48cc9810d5', 'G71-340US Notebook - Lowest Price: $739.00', 'G71-340US Notebook - Lowest Price: $739.00', 'g71-340us-notebook---lowest-price-739-00', 'For those who want to connect and manage everyday computing tasks with a desktop-replacement notebook, the HP G71-340us Notebook PC delivers at a value. Powered by an Intel Core 2 Duo T6600 2.2GHz processor and Windows 7 Home Premium 64-bit as your operating system, the HP G71-340us Notebook PC includes essential features to enhance your PC experience and life.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'For those who want to connect and manage everyday computing tasks with a desktop-replacement notebook, the HP G71-340us Notebook PC delivers at a value. Powered by an Intel Core 2 Duo T6600 2.2GHz processor and Windows 7 Home Premium 64-bit as your operating system, the HP G71-340us Notebook PC includes essential features to enhance your PC experience and life.          ', 'gus, notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(20, 1, 'published', 6699025, 122, 0, 0, '1.00', '2009-12-29 20:08:03', '2009-12-29 20:08:03', '2009-12-29 20:08:03', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=7c9b8200f0fd809c3bc5b8d3b8dca2ef', 'MacBook Notebook - Lowest Price: $954.99', 'MacBook Notebook - Lowest Price: $954.99', 'macbook-notebook---lowest-price-954-99', 'The moment you open your MacBook, its glossy LED-backlit display greets you with glorious, full-screen brightness and brings your photos, movies, and presentations alive with luminous color. The wide screen resolution of 1280 by 800 pixels gives you plenty of room to multitask, yet it?s compact enough to take anywhere. And the display is greener than ever power efficient, free of harmful toxins such as mercury, and made of arsenic-free glass.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'The moment you open your MacBook, its glossy LED-backlit display greets you with glorious, full-screen brightness and brings your photos, movies, and presentations alive with luminous color. The wide screen resolution of 1280 by 800 pixels gives you plenty of room to multitask, yet it?s compact enough to take anywhere. And the display is greener than ever power efficient, free of harmful toxins s', 'macbook, notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(21, 1, 'published', 5114785, 122, 0, 0, '1.00', '2009-12-31 05:40:18', '2009-12-29 20:08:15', '2009-12-29 20:08:15', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=1dc8db4221e5ed8ace1a919d6beedf85', 'Studio 15 Notebook - Lowest Price: $749.98', 'Studio 15 Notebook - Lowest Price: $749.98', 'studio-15-notebook---lowest-price-749-98', 'Get creative and stay connected with the Studio 15 laptop. Its Hi-def, 15.6-inch LED wide screen design is multimedia-rich, and with a choice of colors the Studio 15 is easily personalized to fit your style.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'Get creative and stay connected with the Studio 15 laptop. Its Hi-def, 15.6-inch LED wide screen design is multimedia-rich, and with a choice of colors the Studio 15 is easily personalized to fit your style.          ', 'studio, , notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(22, 1, 'published', 850828, 113, 0, 0, '1.00', '2009-12-31 05:40:16', '2009-12-29 20:08:21', '2009-12-29 20:08:21', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=15a7df921d5f2f75b7cd1d28ac37ba3f', 'Pavilion dv4-1540us Notebook - Lowest Price: $679.99', 'Pavilion dv4-1540us Notebook - Lowest Price: $679.99', 'pavilion-dv4-1540us-notebook---lowest-price-679-99', 'With fluid, modern lines, a cool "Moonlight White" finish, and features inside and out, Pavilion dv4-1540us is ready to surprise and delight you. This laptop includes a webcam plus our MediaSmart software for managing your movies, music, and more.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'With fluid, modern lines, a cool "Moonlight White" finish, and features inside and out, Pavilion dv4-1540us is ready to surprise and delight you. This laptop includes a webcam plus our MediaSmart software for managing your movies, music, and more.          ', 'pavilion, dvus, notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(23, 1, 'published', 4639653, 135, 0, 0, '1.00', '2009-12-31 05:40:14', '2009-12-29 20:08:28', '2009-12-29 20:08:28', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=99f4d6a706463a53caa8b749c1aee3d8', '13.3" MacBook Pro Notebook - Lowest Price: $1149.00', '13.3" MacBook Pro Notebook - Lowest Price: $1149.00', '13-3-macbook-pro-notebook---lowest-price-1149-00', 'The 13-inch MacBook Pro notebook is Built around Mac OS X and the Intel Core 2 Duo processor, MacBook Pro gives you the performance and connectivity of a desktop computer in a portable design that is thin and light enough to take everywhere.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'The 13-inch MacBook Pro notebook is Built around Mac OS X and the Intel Core 2 Duo processor, MacBook Pro gives you the performance and connectivity of a desktop computer in a portable design that is thin and light enough to take everywhere.          ', ', macbook, pro, notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(24, 1, 'published', 8797972, 38, 0, 0, '1.00', '2009-12-31 05:40:12', '2009-12-29 20:27:53', '2009-12-29 20:27:53', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=1bc125f935061dca0a749069e263ecdf', 'Eee PC 1005HA Seashell Netbook - Lowest Price: $289.83', 'Eee PC 1005HA Seashell Netbook - Lowest Price: $289.83', 'eee-pc-1005ha-seashell-netbook---lowest-price-289-83', 'The Eee PC 1005HA-EU1X-BK offers user comfort and convenience with its 92-percent scaled keyboard, multi-touch touchpad and instant key (for quick access to touchpad-lock). The 10.1-inch LED backlit display and sleek chassis will allows to work or travel in absolute comfort for hours on end. The generous 160GB hard disk drive storage will enable you to easily store and access your important data.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'The Eee PC 1005HA-EU1X-BK offers user comfort and convenience with its 92-percent scaled keyboard, multi-touch touchpad and instant key (for quick access to touchpad-lock). The 10.1-inch LED backlit display and sleek chassis will allows to work or travel in absolute comfort for hours on end. The generous 160GB hard disk drive storage will enable you to easily store and access your important data.', 'eee, pc, ha, seashell, netbook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(30, 1, 'published', 6898976, 33, 0, 0, '1.00', '2010-01-06 04:05:15', '2010-01-06 04:05:15', '2010-01-06 04:05:15', 1, 1, 'http://feeds.pcworld.com/click.phdo?i=96a284229dbb76c627d39c8938540e23', 'Pavilion dv6-1350us Notebook - Lowest Price: $749.99', 'Pavilion dv6-1350us Notebook - Lowest Price: $749.99', 'pavilion-dv6-1350us-notebook---lowest-price-749-99', 'If you want digital entertainment and the mobile technology in a cool design, Pavilion dv6-1350us has your bases covered. Its sleek, display gives you full-screen viewing of HD TV and other HD content, and its 12-cell battery significantly extends your running time.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'If you want digital entertainment and the mobile technology in a cool design, Pavilion dv6-1350us has your bases covered. Its sleek, display gives you full-screen viewing of HD TV and other HD content, and its 12-cell battery significantly extends your running time.          ', 'pavilion, dvus, notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(31, 4, 'queued', 2875107, 1, 0, 0, '1.00', '2010-01-06 04:05:16', '2010-01-06 04:05:16', '1999-11-30 08:00:00', 13, 1, 'http://www.buy.com/prod/acer-aspire-5542-15-6-laptop-amd-athlon-x2-dual-core-m300-2-0ghz-4gb/q/loc/101/212511744.html', 'Acer Aspire 5542 15.6" Laptop AMD Athlon X2 Dual-Core M300 2.0GHz, 4GB, 320GB HDD, 802.11n, Webcam, Windows 7 Home Premium (64-bit)', 'Acer Aspire 5542 15.6" Laptop AMD Athlon X2 Dual-Core M300 2.0GHz, 4GB, 320GB HDD, 802.11n, Webcam, Windows 7 Home Premium (64-bit)', 'acer-aspire-5542-15-6-laptop-amd-athlon-x2-dual-core-m300-2-0ghz-4gb-320gb-hdd-802-11n-webcam-windows-7-home-premium-64-bit', 'The 15.6" Aspire 5542 features the latest AMD mobile processor technology to deliver exceptional multitasking performance, superb media experiences, and enhanced ...Our price: $536.99&nbsp;Buy it now for $536.99 (List Price: $549.00)', 'The 15.6" Aspire 5542 features the latest AMD mobile processor technology to deliver exceptional multitasking performance, superb media experiences, and enhanced ...Our price: $536.99&nbsp;Buy it now for $536.99 (List Price: $549.00)', 'acer, aspire, , , laptop, amd, athlon, x, dualcore, m, ghz,, gb,, gb, hdd,, n,, webcam,, windows, , home, premium, bit', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(32, 4, 'published', 542499, 22, 0, 0, '1.00', '2010-01-06 04:05:17', '2010-01-06 04:05:17', '2010-01-06 04:05:17', 2, 1, 'http://feeds.pcworld.com/click.phdo?i=a2d433e843f636dd7abc024e2d373583', 'iPhone 3G S 16GB Black Smartphone - Lowest Price: $199.00', 'iPhone 3G S 16GB Black Smartphone - Lowest Price: $199.00', 'iphone-3g-s-16gb-black-smartphone---lowest-price-199-00', 'Apple iPhone 3G S features video recording, Voice Control, up to 16GB of storage, and more. The first thing you?ll notice about iPhone 3G S is how quickly you can launch applications. Web pages render in a fraction of the time, and you can view email attachments faster. The 3-megapixel camera takes great still photos. Now you can shoot video, edit it, and share it ? all on your iPhone 3G S. Voice Control recognizes the names in your Contacts and knows the music on your iPod.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'Apple iPhone 3G S features video recording, Voice Control, up to 16GB of storage, and more. The first thing you?ll notice about iPhone 3G S is how quickly you can launch applications. Web pages render in a fraction of the time, and you can view email attachments faster. The 3-megapixel camera takes great still photos. Now you can shoot video, edit it, and share it ? all on your iPhone 3G S. Voice', 'iphone, g, gb, black, smartphone, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(33, 6, 'published', 1941654, 27, 0, 0, '1.00', '2010-01-06 04:05:18', '2010-01-06 04:05:18', '2010-01-06 04:05:18', 4, 1, 'http://www.thinkgeek.com/ce9c/?cpg=wnrss', 'Geek Toys : Star Wars Japanese Mini Busts', 'Geek Toys : Star Wars Japanese Mini Busts', 'geek-toys--star-wars-japanese-mini-busts', ' Mini marble style busts of your favorite Star Wars charactersEver wondered what would happen if you took your favorite Star Wars characters, sculpted them as white marble Beethoven style busts, then shrank them down into detailed capsule toys? Neither have we, but apparently someone at Bandai Japan wondered. $7.99', ' Mini marble style busts of your favorite Star Wars charactersEver wondered what would happen if you took your favorite Star Wars characters, sculpted them as white marble Beethoven style busts, then shrank them down into detailed capsule toys? Neither have we, but apparently someone at Bandai Japan wondered. $7.99', 'geek, toys, , star, wars, japanese, mini, busts', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(34, 2, 'queued', 7607633, 3, 0, 0, '1.00', '2010-01-06 04:05:19', '2010-01-06 04:05:19', '1999-11-30 08:00:00', 3, 1, 'http://feeds.pcworld.com/click.phdo?i=e1dcd444d6878b0db63a46057335f190', 'Lumix DMC-FZ35K Black Digital Camera - Lowest Price: $323.95', 'Lumix DMC-FZ35K Black Digital Camera - Lowest Price: $323.95', 'lumix-dmc-fz35k-black-digital-camera---lowest-price-323-95', 'Panasonic Lumix DMC-FZ35 12.1MP Digital Camera features high quality movie recording in AVCHD Lite with Dolby Digital Stereo Creator and SD Link compatibility. Power O.I.S. is about twice as effective in compensating for blurring caused by low-frequency vibration. Ultra High-Speed AF.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'Panasonic Lumix DMC-FZ35 12.1MP Digital Camera features high quality movie recording in AVCHD Lite with Dolby Digital Stereo Creator and SD Link compatibility. Power O.I.S. is about twice as effective in compensating for blurring caused by low-frequency vibration. Ultra High-Speed AF.          ', 'lumix, dmcfzk, black, digital, camera, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
(35, 5, 'published', 3175573, 26, 0, 0, '1.00', '2010-01-06 04:05:20', '2010-01-06 04:05:20', '2010-01-06 04:05:20', 13, 1, 'http://feeds.pcworld.com/click.phdo?i=49d9348a28046f194f0c32487a8d491c', 'Satellite L505D-S5983 Notebook - Lowest Price: $399.99', 'Satellite L505D-S5983 Notebook - Lowest Price: $399.99', 'satellite-l505d-s5983-notebook---lowest-price-399-99', 'The Toshiba Satellite L505D-S5983 notebook PC delivers superior performance at an affordable price. This 6.0-pound notebook features a 2GHz AMD Turion X2 Dual-Core mobile processor with a 1MB L2 cache, 3GB of DDR2 800MHz memory, and a 320GB 5400RPM SATA hard drive, Other great features include built-in speakers & microphone, webcam, and 802.11b/g wireless LAN.<br /><br />  <br />  <br />  <br />  <br />  <br /><br /><br />', 'The Toshiba Satellite L505D-S5983 notebook PC delivers superior performance at an affordable price. This 6.0-pound notebook features a 2GHz AMD Turion X2 Dual-Core mobile processor with a 1MB L2 cache, 3GB of DDR2 800MHz memory, and a 320GB 5400RPM SATA hard drive, Other great features include built-in speakers & microphone, webcam, and 802.11b/g wireless LAN.          ', 'satellite, lds, notebook, , lowest, price, ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0),
